import React from "react"
import { NavLink  } from 'react-router-dom';
import './index.css'


const Menu =()=>{

return (
    <>
    
   <div className="navbar">


 <NavLink exact activeClassName = 'about' to='/'>AboutUS</NavLink>

<NavLink exact activeClassName = 'contact' to='/Contact'>ContactUS</NavLink>

<NavLink  exact activeClassName = 'user' to='/User'>User</NavLink>

<NavLink  activeClassName = 'Error' to='/Service'></NavLink>
 
</div>

</>

);

};

export default Menu;
